def is_prime(n):
    if n < 2:
        return False
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0:
            return False
    return True

def replace_digit_and_create_number(a_digit, b_str, replace_last):
    if replace_last:
        return int(b_str[:-1] + a_digit)
    else:
        return int(a_digit + b_str[1:])

def main():
    with open('test.in', 'r') as file_in:
        a, b = map(int, file_in.readline().split())

    a_str, b_str = str(a), str(b)
    candidates = {a, b}
    for digit in a_str:
        candidates.add(replace_digit_and_create_number(digit, b_str, False))
        candidates.add(replace_digit_and_create_number(digit, b_str, True))

    largest_prime = -1
    for candidate in candidates:
        if is_prime(candidate) and candidate > largest_prime:
            largest_prime = candidate

    result = largest_prime if largest_prime != -1 else max(candidates)

    with open('test.out', 'w') as file_out:
        file_out.write(str(result))

if __name__ == "__main__":
    main()
